import "./Homepage.css";
import Navbar from "./Navbar"

class Homepage extends React.Component {

    render() {


      return (
        <div className="row Homepage">
          <header className="col-12 Home-Header">
            <Navbar/> 
          </header>

          {/* Div to hold the trending projects. */}
          <div className="row">
            <div className="col-12 projects">
              <h2 className="p-e">Hello</h2>
              </div>
          </div>


        </div>
      );
    }
  }

  export default Homepage;
